  return (
    <div>
      <HeaderStudent />
      <div className="main-div">
        <div>
        <div className="form-box">
          
        </div>
        </div>
        <GuideNav />
      </div>
      <WebsiteFooter />
    </div>
  );
};

export default CurrentTraining;
